import React, {Component} from 'react';
import './App.css';

class App extends Component {
  render() {
    var helloWorld = 'Welcome to the Road to learn React';
    return (

      <div className="App">
        <script>alert('What is your first name?');</script>
        <h2>{helloWorld}</h2>
      </div>
    );
  }
}

export default App;
